const updateTableAndChart = (dataEntries, startDate, endDate) => {
            // Filter data based on the selected date range
            const filteredData = dataEntries.filter(entry => {
                const entryDate = new Date(entry.date);
                return entryDate >= startDate && entryDate <= endDate;
            });

            const tableBody = document.getElementById('data-table').getElementsByTagName('tbody')[0];
            tableBody.innerHTML = ''; // Clear existing table data

            filteredData.forEach((row) => {
                let tr = document.createElement('tr');
                tr.innerHTML = `<td>${row.date}</td><td>${row.timePeriod}</td><td>${row.yieldRate}</td>`;
                tableBody.appendChild(tr);
            });

            // Create the chart
            const ctx = document.getElementById('yield-chart').getContext('2d');
            new Chart(ctx, {
                type: 'line',
                data: {
                    labels: filteredData.map(entry => entry.timePeriod),
                    datasets: [{
                        label: 'Yield Curve Spot Rate',
                        data: filteredData.map(entry => entry.yieldRate),
                        borderColor: 'rgb(75, 192, 192)',
                        tension: 0.1
                    }]
                },
                options: {
                    scales: {
                        y: {
                            beginAtZero: false
                        }
                    }
                }
            });
        };

        document.getElementById('update-button').addEventListener('click', () => {
            const startDate = new Date(document.getElementById('start-date').value);
            const endDate = new Date(document.getElementById('end-date').value);

            // Call update function with the selected date range
            updateTableAndChart(data, startDate, endDate);
        });
